const Prices = () => {

    const [loading, setLoading] = useState(initState);
    const [prices, setPrices] = useState([]);

    const getPrices = async () => {
        try {
            const { data: prices } = await getPrices();
            setPrices(prices);
        } catch (e) {
            console.log(e);
        } finally {
            setLoading(false);
        }
    };

    useEffect(
        getPrices

    ,[prices]);

    return "";
};




export default Prices;
